import Layout from '../components/Layout';

const About = () => (
  <Layout>
    <div>
    <Image
        alt="climbing-quote icon"
        src="/climbing-quote.png"
        layout="intrinsic"
        width={512}
        height={512}
        />
    </div>
  </Layout>
  );

  export default About;
